import "../LoginStyle.scss";

export class Profiling extends Component {
  state = {};
  render() {
    return (
    <div>
      <h1>Hi</h1>
      <form>
        <datalist>

          <option>OCBC</option>
          <option>DBS</option>
        </datalist>
      </form>
    </div> )
  }
}
